@Ministerstwo Rozwoju Infrastruktury wprowadza rozporządzenie które nakazuje naprawę wszystkich dróg pozamiejskich.
Każdy Pracownik cywilny ma obowiązek zgłoszenia się do pobliskiego urzędu i przystąpienia do przydzielonej mu pracy dla dobra społeczności

Dyrektywa wprowadzone przez  @Ministerstwo Rozwoju Infrastruktury

@Ministerstwo Prawdy oraz @Ministerstwo Propagandy Informuje iż zakazuje się przyciszania rozgłośni radiowych bądź pojazdów propagandowych puszczających narodowe bądź chwalebne pieśni naszego wspaniałego oraz nie omylnego Państwa Związku Socjalistycznych Republik Europejskich.
Osoby które nie zastosują się do owej dyrektywy zostaną osądzone za zdradę narodu oraz spiskowanie przeciwko ZSRE.

